import PropTypes from 'prop-types'
import Button from './Button'


const SearchBox = ({ title }) => {
    return (
        <header className='search-box'>
            <h1>{title}</h1>
            <Button color='#4285f4' title='Search'/>
        </header>
    )
}

SearchBox.defaultProps = {
    title: "Google Search",
}

SearchBox.propTypes = {
    title: PropTypes.string.isRequired,
}

